import{_ as a,o as t,c as e,O as o}from"./chunks/framework.ed3fd7ea.js";const f=JSON.parse('{"title":"Getting started with GazePlotter","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"upload-data/index.md","filePath":"upload-data/index.md"}'),i={name:"upload-data/index.md"},r=o('<h1 id="getting-started-with-gazeplotter" tabindex="-1">Getting started with GazePlotter <a class="header-anchor" href="#getting-started-with-gazeplotter" aria-label="Permalink to &quot;Getting started with GazePlotter&quot;">​</a></h1><p>GazePlotter is a web application for visualizing gaze data from eye-tracking software. It uses interactive scarf plots (or sequence charts) which are built automatically from the data without any manual configuration and data transformation.</p><p>The workplace is designed to be easy to use and to provide a quick overview of the data and is available at <a href="https://gazeplotter.com" target="_blank" rel="noreferrer">gazeplotter.com</a>.</p><p>On loading the workplace, you will see a demo data visualization. The demo data is a sample of the data from the <a href="./tobii-pro-lab.html">Tobii Pro Lab</a> software. The demo data contains information about <em>fixations</em> (and AOI hits) and <em>saccades</em>. Only other eye-movement category is <em>EyesNotFound</em>.</p><h2 id="upload-data-button" tabindex="-1">Upload data button <a class="header-anchor" href="#upload-data-button" aria-label="Permalink to &quot;Upload data button&quot;">​</a></h2><p>You can upload your own data files to the GazePlotter workplace. The workplace will automatically detect the file type and start a visualization of the data.</p><h3 id="supported-file-types" tabindex="-1">Supported file types <a class="header-anchor" href="#supported-file-types" aria-label="Permalink to &quot;Supported file types&quot;">​</a></h3><p>The workplace supports the following file types:</p><ul><li><a href="./tobii-pro-lab.html">Tobii Pro Lab</a></li><li><a href="./ogama.html">OGAMA</a></li><li><a href="./gazepoint.html">GazePoint</a></li><li><a href="./smi-begaze.html">SMI BeGaze</a></li></ul><h3 id="workplace-data-import" tabindex="-1">Workplace data import <a class="header-anchor" href="#workplace-data-import" aria-label="Permalink to &quot;Workplace data import&quot;">​</a></h3><p>You can also select <code>.json</code> data from the GazePlotter workplace for data upload. This is useful if you want to share your data with someone else.</p><h2 id="reload-demo-data-button" tabindex="-1">Reload demo data button <a class="header-anchor" href="#reload-demo-data-button" aria-label="Permalink to &quot;Reload demo data button&quot;">​</a></h2><p>To revert the workplace to its initial state, hit <code>Reload demo data</code> button. This will remove all the data from the workplace and load the demo data again.</p>',13),l=[r];function d(n,s,p,h,c,u){return t(),e("div",null,l)}const b=a(i,[["render",d]]);export{f as __pageData,b as default};
